import React from 'react';

function Bag() {
  return (
    <div className="bag">
      <div className="bagBlock align-c">
        <img width="20" src="./img/arrow-left.svg"></img>
        <p>Keep shopping</p>
      </div>
      <div className="bagItemsBlock">
        <h4>Bag</h4>
      </div>
    </div>
  );
}

export default Bag;
